import { Component, inject } from '@angular/core';
import { CommonModule } from '@angular/common';
import { BreakpointObserver, Breakpoints } from '@angular/cdk/layout';
import { Observable } from 'rxjs';
import { map, shareReplay } from 'rxjs/operators';
import { MatToolbarModule } from '@angular/material/toolbar';
import { MatButtonModule } from '@angular/material/button';
import { MatSidenavModule } from '@angular/material/sidenav';
import { MatIconModule } from '@angular/material/icon';
import { MatListModule } from '@angular/material/list';

import { DeviceTableComponent } from '../device-table/device-table.component';
import { DeviceMapComponent } from '../path-to-component/app-device-map.component';

export interface DeviceElement {
  endDeviceId: number,
  appId: number,
  packetLoss: number[],
  gatewayId: string,
  time: string[]
  batteryStat: number[]
};

const ELEMENT_DATA: DeviceElement[] = 
[
  {endDeviceId: 123, appId: 456, packetLoss: [1.5, 2, 4], gatewayId: 'gtw1',  time: ['11/17/23 10:05', '11/18/23 12:15', '11/19/23 04:15'], batteryStat: [3,2,1] },
  {endDeviceId: 120, appId: 431, packetLoss: [1.7, 1, 3], gatewayId: 'gtw3', time: ['11/16/23 10:05', '11/18/23 01:15', '11/19/23 04:15'], batteryStat: [3,2,1] },
  {endDeviceId: 143, appId: 464, packetLoss: [1,2,3], gatewayId: 'gtw2', time: ['11/15/23 10:05', '11/18/23 11:15', '11/19/23 04:15'], batteryStat: [3,2,1] }
];

@Component({
  selector: 'app-dashboard',
  templateUrl: './dashboard.component.html',
  styleUrls: ['./dashboard.component.css'],
  standalone: true,
  imports: [
    MatToolbarModule,
    MatButtonModule,
    MatSidenavModule,
    MatIconModule,
    MatListModule,
    CommonModule,
  ],
})
export class DashboardComponent {
  private breakpointObserver = inject(BreakpointObserver);

  isHandset$: Observable<boolean> = this.breakpointObserver
    .observe(Breakpoints.Handset)
    .pipe(
      map((result) => result.matches),
      shareReplay()
    );

  dataSource: DeviceElement[] = ELEMENT_DATA;
}
<p>dashboard works!</p>
<!--This is the side nave container, and it wraps everything because otherwaise the side bar wouldn't be able to pop out over page-->
<mat-sidenav-container class="sidenav-container">
    <!-- Can add ngclass that defines a hidden which only shows the hamburger side nav if the user is on handheld mode, mode makes the side bar either push or appear over main page -->
    <mat-sidenav
    #drawer
    class="sidenav"
    fixedInViewport="false"
    [attr.role]="(isHandset$ | async) ? 'dialog' : 'navigation'"
    [mode]="'over'"
    [opened]="false"
    >
    <mat-toolbar>Organizations</mat-toolbar>
    <button mat-raised-button color="accent">Add</button>
    <button mat-raised-button color="warn">Remove</button>
    <mat-nav-list>
        <a mat-list-item href="#">Organization 1</a>
        <a mat-list-item href="#">Organization 2</a>
        <a mat-list-item href="#">Organization 3</a>
    </mat-nav-list>
    </mat-sidenav>
    <mat-sidenav-content>
    <mat-toolbar color="primary">
        <button
        type="button"
        aria-label="Toggle sidenav"
        mat-icon-button
        (click)="drawer.toggle()"
        >
        <mat-icon aria-label="Side nav toggle icon">menu</mat-icon>
        </button>
        <p>Organization Home</p>
        <span class="push-links-right"></span>
        <p>Hello,</p>
        <a href="#">userName</a>
    </mat-toolbar>
    <!-- Add Content Here, ng-content is used for angular content projection so we can add stuff in tool-bar wrapper in app html -->
    <ng-content></ng-content>
    </mat-sidenav-content>

    <app-device-table [Devicelist]="dataSource"></app-device-table>

    <mat-divider></mat-divider>

    <app-device-map [Devicelist]="dataSource"></app-device-map>
</mat-sidenav-container>
